import React from "react";
import {useDispatch, useSelector} from "react-redux";
import {useHistory, useLocation} from "react-router";
import authSlice from "../store/slices/Auth";
import useSWR from 'swr';
import styled from "styled-components";
import Button from "../components/styled/Button.styled";
import Input from "../components/Inputs/Input";
import H3 from "../components/styled/H3.styled";
import { Colors, TextStyles } from "../Theme";
//import {fetcher} from "../utils/Axios";
import {UserResponse} from "../utils/Types";
import {RootState} from "../store";
import axios from "axios";

const AppEl = styled.div`
display: flex;
ustify-content: center;
justify-content: center;
align-items: center;
flex-direction: column;
height: 60vh;
width: 30vw;
background: rgba(255, 255, 255, 0.15);
box-shadow: 0 8px 32px 0 rgba(31, 38, 135, 0.37);
backdrop-filter: blur(100rem);
-webkit-backdrop-filter: blur(100rem);
border-radius: 10px;
color: #ffffff;
text-transform: uppercase;
letter-spacing: 0.4rem;
`;

const ButtonContainer = styled.div`
  margin: 3rem 0 2rem 0;
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const Profile = () => {
  const account = useSelector((state: RootState) => state.auth.account);
  const dispatch = useDispatch();
  const history = useHistory();

  const userId = account?.id;

  const user = useSWR<UserResponse>(`/user/${userId}/`,axios)

  const handleLogout = () => {
    //dispatch(authSlice.actions.setLogout());
    history.push("/home");
  };
  return (


    <div className="w-full h-screen">
      <div className="w-full p-6">
      <h1> HEEELOOO</h1>
      <ButtonContainer>
        <button
          onClick={handleLogout}
          className="rounded p-2 w-32 bg-red-700 text-white"
        >
          Wyloguj siÄ™
        </button>
      </ButtonContainer>
      </div>
        {
            user.data ?
                <div className="w-full h-full text-center items-center">
                    <p className="self-center my-auto">Welcome, {user.data?.username}</p>
                </div>
                :
                <p className="text-center items-center">Loading ...</p>
        }
    </div>
  );
};

export default Profile;
